import React from 'react';
import logo from '../assets/img/logorustaco.png';
import '../assets/styles.css';

// Navbar: barra más chica, logo más grande y sobresaliente, botones alineados
const Navbar = () => (
  <nav
    className="navbar navbar-centered navbar-thin"
    style={{
      position: 'relative',
      minHeight: '36px', // navbar más chica
      padding: 0,
      background: 'linear-gradient(90deg, #23201a 80%, #e25822 100%)',
      borderBottom: '2px solid var(--rust-orange)',
      boxShadow: 'var(--rust-shadow)',
      zIndex: 2,
      display: 'flex',
      alignItems: 'flex-end',
      justifyContent: 'center',
    }}
  >
    {/* Botones izquierda */}
    <div style={{
      display: 'flex',
      alignItems: 'center',
      gap: '1rem',
      flex: 1,
      justifyContent: 'flex-end',
      height: '100%',
      paddingBottom: '0.1rem'
    }}>
      <a href="/" className="nav-btn">Inicio</a>
      <a href="/events" className="nav-btn">Stats</a>
    </div>
    {/* Logo centrado y sobresaliente */}
    <div
      style={{
        display: 'flex',
        alignItems: 'flex-end',
        justifyContent: 'center',
        position: 'relative',
        zIndex: 10,
        height: '100%',
        minWidth: 0
      }}
    >
      <img
        src={logo}
        alt="Rustaco Logo"
        className="logo-animated"
        height={100} // logo más grande
        width={100}
        style={{
          marginBottom: '-32px', // sobresale más
          background: 'rgba(35,32,26,0.97)',
          borderRadius: '50%',
          boxShadow: '0 8px 32px #000a, 0 0 0 6px #e25822',
          objectFit: 'cover',
          border: '2.5px solid #23201a'
        }}
      />
    </div>
    {/* Botones derecha */}
    <div style={{
      display: 'flex',
      alignItems: 'center',
      gap: '1rem',
      flex: 1,
      justifyContent: 'flex-start',
      height: '100%',
      paddingBottom: '0.1rem'
    }}>
      <a href="/about" className="nav-btn">Nosotros</a>
      <a href="/contact" className="nav-btn">Contacto</a>
    </div>
    {/* Botón Steam a la derecha absoluta */}
    <div style={{
      position: 'absolute',
      right: 14,
      bottom: 8,
      display: 'flex',
      alignItems: 'center',
      zIndex: 20
    }}>
      <a
        href="http://localhost:3001/auth/steam"
        className="nav-btn steam-btn"
        style={{
          display: 'flex',
          alignItems: 'center',
          gap: '0.4rem',
          fontWeight: 700,
          background: '#181d25',
          color: '#66c0f4',
          border: '1px solid #66c0f4',
          boxShadow: '0 2px 8px #0004',
          padding: '0.35rem 0.9rem',
          fontSize: '0.95rem',
          transition: 'background 0.2s, color 0.2s, box-shadow 0.2s, border 0.2s'
        }}
      >
        <svg width="16" height="16" viewBox="0 0 256 256" style={{ display: 'block' }}>
          <circle cx="128" cy="128" r="128" fill="#171a21"/>
          <ellipse cx="128" cy="128" rx="110" ry="110" fill="#2a475e"/>
          <circle cx="128" cy="128" r="38" fill="#66c0f4" stroke="#fff" strokeWidth="6"/>
          <circle cx="128" cy="128" r="18" fill="#fff"/>
        </svg>
        Login Steam
      </a>
    </div>
  </nav>
);

const Header = () => (
  <header className="header" style={{ marginTop: '5rem', padding: '0.7rem 0 0.3rem 0', textAlign: 'center' }}>
    <h1 style={{
      fontSize: '1.6rem',
      color: 'var(--rust-orange)',
      letterSpacing: '2px',
      marginBottom: '0.3rem',
      textShadow: '2px 2px 8px #000a',
      fontWeight: 900,
      animation: 'fadeDown 1s cubic-bezier(.4,0,.2,1)'
    }}>
      Bienvenido a Rustaco Eventos
    </h1>
    <p style={{
      color: 'var(--rust-accent)',
      fontSize: '1rem',
      margin: 0,
      animation: 'fadeDown 1.2s cubic-bezier(.4,0,.2,1)'
    }}>
      Organización profesional de torneos y eventos en el mundo de Rust.
    </p>
  </header>
);

const Footer = () => (
  <footer className="footer">
    &copy; {new Date().getFullYear()} Rustaco Eventos &mdash; Inspirado en Rust. Todos los derechos reservados.
  </footer>
);

const Home = () => (
  <>
    <Navbar />
    <Header />
    <Footer />
  </>
);

export default Home;
